import { Button, Card } from "@mantine/core";
import React, { useEffect } from "react";
import Home from "./home1";
import './Page.css';
import { useState } from "react";
import modal from "./modal_cart";
import { Modal } from "@mantine/core";
import {useDisclosure} from "@matine/hooks";
function pending()
{
    const [opened,{open,close}]=useDisclosure(false);
    function modal()
    { 
    return(
        <div role='dialog'>
           <Modal opened={opened} onClose={close} title="Authentication">
            <h1>Hello world</h1>
             </Modal>
        </div>
    )
    }

    
    return(
        <Card className="Cart_card">
            <p>
            <Button className="corner_button" onClick={()=>{open}}>+ ADD</Button>
                <table border={3} style={{marginTop:"70px",maxwidth:"1000px"}}>
                    <tr>
                        <td>Hello </td>
                    </tr>
                </table>
            </p>
        </Card>
    )
}

function Cart()
{ 
    
    const [rel,setRel]=useState(pending())
     useEffect(()=>{
        setRel(pending())
     },[rel])
    return(
        <div>
            <Button className="Cart_Button">Bought</Button>
            <Button className="Cart_Button">Pending</Button>
            {rel};
        </div>
    )
}

export default Cart
